var mongoose   =require("mongoose");
var Camp       =require("./models/campgrounds");
var Comment    =require("./models/comment");



var data = [
			{
				name:"goa",
				image:"data:image/jpeg;base64,",
				description:"Goa is a state on the southwestern coast of India within the region known as the Konkan, separated from the Deccan highlands of the state of Karnataka by the Western Ghats.[5] It is bounded by Maharashtra to the north and Karnataka to the east and south, with the Arabian Sea forming its western coast. It is India's smallest state by area and the fourth-smallest by population. Goa has the highest GDP per capita among all Indian states,[6] two and a half times that of the country.[7] It was ranked the best-placed state by the Eleventh Finance Commission for its infrastructure and ranked on top for the best quality of life in India by the National Commission on Population based on the 12 Indicators."

			},
			{
				name:"ladakh",
				image:"data:image/jpeg;base64,",
				description:"Ladakh is a region in the Indian state of Jammu and Kashmir that currently extends from the Siachen Glacier in the Karakoram range to the main Great Himalayas to the south, inhabited by people of Indo-Aryan and Tibetan descent.[3][4] It is one of the most sparsely populated regions in Jammu and Kashmir and its culture and history are closely related to that of Tibet. Ladakh is renowned for its remote mountain beauty and culture."

			},
			{
				name:"dharamshala",
				image:"data:image/jpeg;base64,",
				description:"Dharamshala is a city in the Indian state of Himachal Pradesh. Surrounded by cedar forests on the edge of the Himalayas, this hillside city is home to the Dalai Lama and the Tibetan government-in-exile. The Thekchen Chöling Temple Complex is a spiritual center for Tibetan Buddhism, while the Library of Tibetan Works and Archives houses thousands of precious manuscripts"

			}

];

function seedDB(){
	//remove all campgrounds 
	// we can also use deleteOne or deleteMany in place of remove.
	Camp.deleteMany({},function(err){
		if(err){
			console.log(err);
		}
		console.log("removed campgrounds");
	

	// add a few campgrounds
	data.forEach(function(seed){
		Camp.create(seed,function(err,camp){
			if(err)
				console.log(err);
			else{
				console.log("added a campground");
				//CREATE A COMMENT
				Comment.create(
					{
						text: "this is a land of warriors",
						writer: "Maharana"
					},function(err, comment){
						if(err){
						console.log(err);
						}else{
						camp.comments.push(comment);
						camp.save();
						console.log("created new comment");
						}
						
					});

			}
		});
	});
  });

}
module.exports= seedDB;